import React from "react";
import { Route, Switch } from "react-router-dom";
import routes from "./Routes/Index";
function App(props) {
  return (
    <div className="row">
      <div className="col-xl-2"><MenuBar /></div>
      <div className="col-xl-10">
        <HeaderTop />
        <Switch>{show(routes)}</Switch>
      </div>
    </div>
  );
}
export default App;
